<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />

  <title>Kimball → Tifco Lookup</title>

  <!-- iPad / “app mode” friendliness -->
  <meta name="apple-mobile-web-app-capable" content="yes" />
  <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent" />
  <meta name="apple-mobile-web-app-title" content="Tifco Lookup" />

  <style>
    :root {
      /* Tifco-ish blue theme; tweak if you want a different shade */
      --brand-blue: #004c97;
      --brand-blue-light: #e6f0fb;
      --brand-blue-dark: #003362;
      --bg: #f3f4f7;
      --card-bg: #ffffff;
      --border-soft: #d0d4dc;
      --text-main: #22252c;
      --text-muted: #6b7280;
      --danger: #b91c1c;
      --radius: 12px;
      --shadow-soft: 0 10px 25px rgba(15, 23, 42, 0.08);
    }

    * {
      box-sizing: border-box;
    }

    body {
      margin: 0;
      font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", system-ui, sans-serif;
      background: radial-gradient(circle at top left, #ffffff, var(--bg));
      color: var(--text-main);
      min-height: 100vh;
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 16px;
    }

    .shell {
      width: 100%;
      max-width: 540px;
    }

    .card {
      background: var(--card-bg);
      border-radius: 18px;
      box-shadow: var(--shadow-soft);
      padding: 20px 20px 16px;
      border: 1px solid rgba(148, 163, 184, 0.3);
    }

    header {
      margin-bottom: 16px;
    }

    header h1 {
      margin: 0 0 4px;
      font-size: 22px;
      font-weight: 700;
      letter-spacing: 0.02em;
      color: var(--brand-blue-dark);
    }

    header p {
      margin: 0;
      font-size: 14px;
      color: var(--text-muted);
    }

    .input-row {
      margin-top: 16px;
    }

    label {
      display: block;
      margin-bottom: 6px;
      font-size: 13px;
      text-transform: uppercase;
      letter-spacing: 0.06em;
      color: var(--text-muted);
      font-weight: 600;
    }

    .field-row {
      display: flex;
      gap: 8px;
    }

    input[type="text"] {
      flex: 1;
      padding: 10px 12px;
      border-radius: 10px;
      border: 1px solid var(--border-soft);
      font-size: 16px;
      outline: none;
      transition: border-color 0.15s ease, box-shadow 0.15s ease, background-color 0.15s ease;
      background-color: #f9fafb;
    }

    input[type="text"]:focus {
      border-color: var(--brand-blue);
      background-color: #ffffff;
      box-shadow: 0 0 0 1px rgba(0, 76, 151, 0.25);
    }

    button {
      border-radius: 10px;
      padding: 0 14px;
      border: none;
      font-size: 15px;
      font-weight: 600;
      cursor: pointer;
      white-space: nowrap;
      display: inline-flex;
      align-items: center;
      justify-content: center;
      gap: 6px;
      transition: background-color 0.12s ease, box-shadow 0.12s ease, transform 0.05s ease;
    }

    .btn-primary {
      background: var(--brand-blue);
      color: #ffffff;
      box-shadow: 0 4px 10px rgba(0, 76, 151, 0.35);
    }

    .btn-primary:active {
      transform: translateY(1px);
      box-shadow: 0 2px 6px rgba(0, 76, 151, 0.35);
    }

    .btn-secondary {
      background: #e5e7eb;
      color: #111827;
      font-size: 13px;
      padding: 4px 10px;
      border-radius: 999px;
    }

    .result {
      margin-top: 18px;
      padding: 12px 12px 10px;
      border-radius: 12px;
      background: var(--brand-blue-light);
      border: 1px solid rgba(0, 76, 151, 0.15);
      font-size: 15px;
      display: none;
      align-items: flex-start;
      justify-content: space-between;
      gap: 8px;
    }

    .result-main {
      flex: 1;
    }

    .result-label {
      font-size: 12px;
      text-transform: uppercase;
      letter-spacing: 0.09em;
      color: var(--brand-blue-dark);
      margin-bottom: 4px;
      font-weight: 600;
    }

    .result-value {
      font-size: 19px;
      font-weight: 700;
      color: var(--brand-blue-dark);
      word-break: break-all;
    }

    .pill {
      display: inline-flex;
      align-items: center;
      gap: 6px;
      font-size: 11px;
      padding: 3px 8px;
      border-radius: 999px;
      background-color: rgba(22, 163, 74, 0.1);
      color: #15803d;
      margin-top: 4px;
    }

    .pill.error {
      background-color: rgba(185, 28, 28, 0.08);
      color: var(--danger);
    }

    .hint {
      margin-top: 8px;
      font-size: 12px;
      color: var(--text-muted);
    }

    footer {
      margin-top: 10px;
      text-align: center;
      font-size: 11px;
      color: #9ca3af;
    }

    code {
      font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace;
      font-size: 12px;
      background: rgba(15, 23, 42, 0.03);
      padding: 2px 4px;
      border-radius: 4px;
    }

    @media (prefers-color-scheme: dark) {
      body {
        background: radial-gradient(circle at top left, #020617, #020617);
        color: #e5e7eb;
      }
      .card {
        background: #020617;
        border-color: rgba(51, 65, 85, 0.9);
      }
      header h1 {
        color: #e5e7eb;
      }
      header p {
        color: #9ca3af;
      }
      input[type="text"] {
        background: #020617;
        color: #e5e7eb;
        border-color: #374151;
      }
      input[type="text"]:focus {
        background: #020617;
      }
      .result {
        background: rgba(15, 23, 42, 0.9);
        border-color: rgba(37, 99, 235, 0.7);
      }
      .result-value {
        color: #e5e7eb;
      }
      .hint {
        color: #9ca3af;
      }
      footer {
        color: #6b7280;
      }
    }
  </style>
</head>
<body>
  <div class="shell">
    <div class="card">
      <header>
        <h1>Kimball → Tifco Lookup</h1>
        <p>Type a Kimball Midwest part number to see the matching Tifco PN.</p>
      </header>

      <section class="input-row">
        <label for="kimball-input">Kimball part number</label>
        <div class="field-row">
          <input
            id="kimball-input"
            type="text"
            placeholder="e.g. 75712E-312"
            autocomplete="off"
            autocapitalize="characters"
            spellcheck="false"
          />
          <button id="search-btn" class="btn-primary" type="button">
            Search
          </button>
        </div>
      </section>

      <div id="result" class="result">
        <div class="result-main">
          <div class="result-label">Tifco part</div>
          <div id="result-value" class="result-value"></div>
          <div id="result-pill" class="pill"></div>
        </div>
        <button id="copy-btn" class="btn-secondary" type="button" style="display:none;">
          Copy
        </button>
      </div>

      <p class="hint">
        Search ignores case and spaces. If a Kimball PN isn’t found, double-check that it’s in the 2016 crossover list.
      </p>
    </div>

    function normalizeKimball(input) {
      return input.toUpperCase().replace(/\s+/g, "");
    }

    function lookupKimball(kimballRaw) {
      if (!kimballRaw) return null;
      var key = normalizeKimball(kimballRaw);
      return mapping[key] || null;
    }

    function setResult(found, kimballInput, tifcoValue) {
      var container = document.getElementById("result");
      var valueEl = document.getElementById("result-value");
      var pillEl = document.getElementById("result-pill");
      var copyBtn = document.getElementById("copy-btn");

      if (!container || !valueEl || !pillEl) return;

      if (!kimballInput) {
        container.style.display = "none";
        return;
      }

      container.style.display = "flex";

      if (found && tifcoValue) {
        valueEl.textContent = tifcoValue;
        pillEl.classList.remove("error");
        pillEl.textContent = "Match found for " + kimballInput.trim();
        copyBtn.style.display = "inline-flex";
      } else {
        valueEl.textContent = "No match found";
        pillEl.classList.add("error");
        pillEl.textContent = "Check the Kimball PN and try again";
        copyBtn.style.display = "none";
      }
    }

    function doLookup() {
      var inputEl = document.getElementById("kimball-input");
      if (!inputEl) return;

      var raw = inputEl.value || "";
      if (!raw.trim()) {
        setResult(false, "", null);
        return;
      }

      var tifco = lookupKimball(raw);
      setResult(!!tifco, raw, tifco);
    }

    function setupUI() {
      var inputEl = document.getElementById("kimball-input");
      var searchBtn = document.getElementById("search-btn");
      var copyBtn = document.getElementById("copy-btn");
      var resultValue = document.getElementById("result-value");

      if (searchBtn) {
        searchBtn.addEventListener("click", doLookup);
      }

      if (inputEl) {
        inputEl.addEventListener("keyup", function (e) {
          if (e.key === "Enter") {
            doLookup();
          }
        });
      }

      if (copyBtn && resultValue) {
        copyBtn.addEventListener("click", function () {
          var text = resultValue.textContent || "";
          if (!text || text === "No match found") return;

          if (navigator.clipboard && navigator.clipboard.writeText) {
            navigator.clipboard.writeText(text).then(
              function () {
                copyBtn.textContent = "Copied";
                setTimeout(function () {
                  copyBtn.textContent = "Copy";
                }, 1200);
              },
              function () {
                copyBtn.textContent = "Error";
                setTimeout(function () {
                  copyBtn.textContent = "Copy";
                }, 1200);
              }
            );
          }
        });
      }
    }

    window.addEventListener("DOMContentLoaded", setupUI);
  </script>
